	void runSelect(Connection conn, String query) throws SQLException {
		PreparedStatement ps = conn.prepareStatement(query, ResultSet.TYPE_SCROLL_INSENSITIVE, ResultSet.CONCUR_READ_ONLY);
		try(ResultSet rs = ps.executeQuery()) {
			int nrColumns = rs.getMetaData().getColumnCount();
			while (rs.next()) {
				List<Object> res = new ArrayList<>();
				for(int i = 0; i < nrColumns; i++)
					res.add(rs.getObject(i + 1));
				if (res.size() > 100)
					System.out.println("should not happen");
			}
		}
	}

	double printRuntimes(long[] runTimes, int i) {
		System.out.println("attempt #" + i + ", query runtimes so far");
		double roundDuration = 0.0;
		for(int j = 0; j < runTimes.length; j++) {
			System.out.format("\tquery %d has avg runtime %.2f\n", j + 1, runTimes[j] * 1.0 / i);
			roundDuration += runTimes[j] * 1.0 / i;
		}
		System.out.format("round duration: %.2f\n", roundDuration);
		return roundDuration;
	}
	
